import React, { Component } from 'react';
import {
  Platform,
  StyleSheet,
  Text,
  View,
  TouchableHighlight,
  Image,
  ImageBackground
} from 'react-native';

const Images = [
  { 
    uri: 'data:image/jpeg;base64,',
    label: 'Gaillardia'
  },
  { 
    uri: 'data:image/jpeg;base64,',
    label: 'Rose'
  },
  { 
    uri: 'data:image/jpeg;base64,',
    label: 'Purple hibiscus'
  },
  { 
    uri: 'data:image/jpeg;base64,',
    label: 'Another flower'
  }
];



//type Props = {};
export default class App extends Component {

  state = {
    index: 0,
    imageWidth: null
  }

  nextImage(event) {
    const { index, imageWidth } = this.state,
          X = event.nativeEvent.locationX,
          delta = (X < imageWidth/2) ? -1 : +1;

    let newIndex = (index + delta) % Images.length;

    if (newIndex < 0) {
        newIndex = Images.length - Math.abs(newIndex);
    }

    this.setState({
        index: newIndex
    });
}

onImageLayout(event) {
    this.setState({
        imageWidth: event.nativeEvent.layout.width
    });
}
  render() {
    const image = Images[this.state.index];

    return (
      <View style={styles.container}>
        <Text style={styles.welcome}>
          Klik!
        </Text>  
        <View style={styles.empty} />
        <TouchableHighlight onPress={this.nextImage.bind(this)}
                                    style={styles.image}>
                <ImageBackground source={{uri: image.uri}}
                       style={styles.image}>
                    <Text style={styles.imageLabel}>{image.label}</Text>
                </ImageBackground>
        </TouchableHighlight>
        <Text style={styles.info}>Tap on image</Text>        
                <View style={styles.empty} />
        <Text style={styles.byline}>
           built by DIGIREALIS &copy; 2018.
        </Text>        
      </View>
    );
  }
}

